import ModalNotes from "./ModalComponent";

function Item(props) {
  const { note } = props;
  const { text, time, title } = note;
  {
    console.log(props);
  }
  return (
    <li className="note">
      {time}
      <p>{text}</p>
      <p>{title}</p>
      <button onClick={() => props.onDelete(props.index)}>Delete</button>
      <ModalNotes
        onChangeNote={(value)=>{onChangeNote(value)}}
        modalNotes={props}
        onChange={(value) => alert(value)}
      ></ModalNotes>
    </li>
  );
}
export default Item;
